import React from 'react';
import styled from 'styled-components';
import ResumeListHeader from './ResumeListHeader';

function CvList() {
	return (
		<ComponentWrapper>
			<ResumeListHeader />
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
`;

export default CvList;
